function CourseListComponent() {
    const data ={

        "course" :[
          {
            "coursename":"John"
          },
          {
            "coursename":"Jack"
          },
          {
            "coursename":"Oliver"
          },
        ]
      }

      useEffect (
        () => {
          handleSubmit()
        }, []
      )

        function handleSubmit(){

          fetchingStudentsList()
                .then((response) => successResponse(response))
                .catch((error) => errorResponse(error))
                .finally(()=> console.log('cleanup'))
      }

      function successResponse(response){
        setStudents(response.data)
        setMessage('Students List')
    }

    function errorResponse(response){
      console.log(response)

  }

  function deleteStudent(name) {
    console.log('clicked ' + name)
    deleteStudentApi(name)
    .then(

        () => {
          setDeletemessage(`Delete of Students with name = ${name} successful`)
            handleSubmit()
        }
        //1: Display message
        //2: Update Todos list
    )
    .catch(error => console.log(error))
  }

    return (
    <div className="container">
        <h1>Courses Lists</h1>

        <table className="table">
          <thead>
            <tr>
              <td>Course Name</td>
              <td>Delete</td>
            </tr>
          </thead>
          <tbody>
            {data.course.map((item, i) => (
              <tr key={i}>
                <td>{item.coursename}</td>
              </tr>
            ))}
          </tbody>
        </table>

        <div className="text-info">{message}</div>
            <div className="alert alert-warning">{deletemessage}</div>

            <div>
                <table className="table">
                    <thead>
                      <tr>
                        <th>Course Name</th>
                        <th>Family Name</th>
                        <th>DOB</th>
                        <th>Email</th>
                        <th>Delete</th>
                      </tr>
                    </thead>
                    <tbody>
                    {
                        students.map(
                            student => (
                                <tr key={student.name}>
                                    <td>{student.name}</td>
                                    <td>{student.familyName}</td>
                                    <td>{student.dob}</td>
                                    <td>{student.email}</td>
                                    <td> <button className="btn btn-warning" 
                                                    onClick={() => deleteStudent(student.name)}>Delete</button> </td>
                                </tr>
                            )
                        )
                    }
                    </tbody>

                </table>
            </div>

    </div>
    )
}

export default CourseListComponent
